import React from "react";
import { Col } from "react-bootstrap";
import "@styles/components/CategoryBox.css";

const CategoryBox = () => {
  const categories = [
    { title: "Новости и политика" },
    { title: "Транспорт" },
    { title: "Мода и красота" },
    { title: "Юмор" },
    { title: "Образование" },
    { title: "Развлечения" },
    { title: "Для всей семьи" },
    { title: "Кино и анимация" },
    { title: "Кулинария" },
    { title: "Игры" },
    { title: "Хобби и стиль" },
    { title: "Музыка" },
    { title: "Общественная деятельность" },
    { title: "Люди и блоги" },
    { title: "Животные" },
    { title: "Наука и техника" },
    { title: "Спорт" },
    { title: "Путешествия" },
  ];

  return (
    <>
      {categories.map((category) => {
        return (
          <Col lg={3} md={4} sm={6} xs={12}  className="my-2">
            <div className="category-box">
              <h6>{category.title}</h6>
            </div>
          </Col>
        );
      })}
    </>
  );
};

export default CategoryBox;
